import daily from '../../assets/icons/icon_daily.svg';
import wallet from '../../assets/icons/icon_wallet.svg';
import carSimple from '../../assets/icons/icon_car_simple.svg';

const benefitsData = [
  {
    img: carSimple,
    description: 'Across Los Angeles',
  },
  {
    img: daily,
    description: 'Daily: 9AM–6PM',
  },
  {
    img: wallet,
    description: '$100+ Free Delivery',
  },
];
export default benefitsData;
